/**
 * function for parsing keycode from keystroke event into a
 * single character. necessary because of poor keystroke event
 * support in Safari.
 * @param {Event} event Keystroke event
 * @return {string} single-char string or null, or empty string
 *  on failure.
 */
export function getChar(event) {
  const code = event.keyCode;
  if (code === 32) return ' '; // spacebar
  if (event.shiftKey) { // if shift key depressed
    if (code <= 91 && code >= 65) { // capital letters
      return String.fromCharCode(code);
    }

    switch (code) {
      case 49: return '!';
      case 50: return '@';
      case 51: return '#';
      case 52: return '$';
      case 53: return '%';
      case 54: return '^';
      case 55: return '&';
      case 56: return '*';
      case 57: return '(';
      case 58: return ')';
      case 189: return '_';
      case 187: return '+';
      case 219: return '{';
      case 221: return '}';
      case 220: return '|';
      case 186: return ':';
      case 222: return '"';
      case 191: return '?';
      case 190: return '>';
      case 188: return '<';
      case 192: return '~';
      default:
        break;
    }
  // shift key not depressed
  } else if ((code <= 91 && code >= 65) || (code <= 57 && code >= 48)) {
    return String.fromCharCode(code).toLowerCase(); // lowercase & nums
  } else {
    switch (code) {
      case 189: return '-';
      case 187: return '=';
      case 219: return '[';
      case 221: return ']';
      case 220: return '\\';
      case 186: return ';';
      case 222: return "'";
      case 191: return '/';
      case 190: return '.';
      case 188: return ',';
      case 192: return '`';
      default:
        break;
    }
  }
  return '';
}

/**
 * print output to screen. format if necessary
 * TODO: consider refactoring into seperate functions for
 * single string and array.
 * @param {string|string[]} output String or array of strings to print
 * @param {HTMLElement} target HTML element to print to
 */
export function print(output, target) {
  if (typeof output === 'string') {
    target.append(`<li>${output}</li>`);
  } else if (typeof output === 'object') {
    output.forEach(line => print(line, target));
  }
}

/**
 * print output to screen without linebreaks
 * @param {string[]} output Array of strings to print
 * @param {HTMLElement} target HTML element to print to
 */
export function printInline(output, target) {
  output.forEach((line) => {
    target.append(`<li class='inline'>${line}</li>`);
  });
}

/**
 * Object encapsulating information to be passed to a shell command
 * @class
 */
export class ShellCommand {
  /**
   * @constructor
   * @param {string} input User-inputted statement from terminal
   */
  constructor(input) {
    /**
     * @type {string}
     */
    this.originalInput = input;
    /**
     * @type string[]
     */
    this.args = [];
    /**
     * @type string[]
     */
    this.flags = [];
    /**
     * @type string
     */
    this.command = '';

    this.parseInput();
  }

  /**
   * Parse input string into flags & args
   */
  parseInput() {
    const splitInput = this.originalInput.split(' ');
    this.command = splitInput[0];
    if (splitInput.length > 1) {
      splitInput.slice(1).forEach((word) => {
        if (word.length > 0 && word[0] === '-') {
          this.flags.push(word);
        } else if (word.length > 0 && word !== ' ') {
          this.args.push(word);
        }
      });
    }
  }
}

/**
 * Object containing results of shell action
 * @class
 */
export class ShellCommandResult {
  /**
   * @constructor
   * @param {string[]} stdOut Results of succesful action
   * @param {string[]} stdErr Results of unsuccesful action
   * @param {*} data Wildcard data that the command may need to pass back (for example,
   * a newly created file)
   */
  constructor(stdOut, stdErr, data) {
    /**
     * @type {string[]}
     */
    this.stdOut = stdOut || [];
    /**
     * @type {string[]}
     */
    this.stdErr = stdErr || [];
    /**
     * @type {*}
     */
    this.data = data;
  }

  /**
   * return stdErr if it is not undefined, stdOut if it isn't,
   * and an empty array if neither are.
   * @return {string[]}
   */
  getDefaultOutput() {
    return this.stdOut.concat(this.stdErr);
  }

  /**
   * combine two shellCommandResults into one for use in
   * recursive or chained functions
   * @param {ShellCommandResult} otherResult
   * @return {ShellCommandResult}
   */
  combine(otherResult) {
    this.stdErr += otherResult.stdErr;
    this.stdOut += otherResult.stdOut;
    this.data += otherResult.data;
  }

}

